webpackJsonp([32448081054674],{407:function(t,a){t.exports={data:{markdownRemark:{html:"<p><strong>本日の戦績: 3,681円→4,289円 (+598円 +16.2% / 今月累積42.6%)</strong> やったぜ。 これはもうミニマムサクセスの月利 5 パーセントを大幅に超えて、フルサクセスの月利 50 パーセントも視野に入ってきたかもね。 まあたぶん 45 パーセント辺りで時間切れだとは思うけど。  たぶん上旬中旬もちゃんとやってたら、この調子だと月利 150 パーセントくらいはいけそうな感じ。 尤も、まだ<em>たった三連勝なので、組んだルールとたまたま相性が良い相場だっただけかもしれない</em>ため、もうちょっと様子見していきたいと思います。 それとまだ注文ルールの穴が残ってて、あるパターンにはまるとルールが狂ってしまうので、この辺も詰めていく必要がありますね。 ちなみに来月の増資(現金投入)は、2月の10日前後をめどに、3万から6万くらい突っ込む予定です。</p>",frontmatter:{cover:null,date:"2016-01-28T22:11:39+09:00",strDate:"2016/1/28",title:"[FX]三連勝！"}}},pathContext:{path:"/ja/blog/2016/01/28-fx三連勝！/",langKey:"ja"}}}});
